function generate(reportName, category, site, station, from, to, number, imgData) {
    var doc = new jsPDF('p', 'pt', 'letter');
    var imgData = new Image();

    var pageHeight = 0;
    pageHeight = doc.internal.pageSize.height;
    specialElementHandlers = {
        // element with id of "bypass" - jQuery style selector  
        '#bypassme': function (element, renderer) {
            // true = "handled elsewhere, bypass text extraction"  
            return true
        }
    };
    margins = {
        top: 150,
        bottom: 60,
        left: 40,
        right: 40,
        width: 600
    };
    var y = 20;
    doc.setLineWidth(2);
    doc.setFontSize(14);
    doc.setTextColor(60, 9,108);


    var imgData ='data:image/png;base64,'

    doc.addImage(imgData, 'PNG', 230, 5, 150, 45)
  
    doc.text("Ambient Air Quality Monitoring System", doc.internal.pageSize.width / 2, y = y + 45, { align: 'center' });
    doc.setFontSize(12);
    doc.setFontSize(10);
    doc.text("Category: " + category + "   Site: " + site + "    Station: " + station,
        doc.internal.pageSize.width / 2, y = y + 20, { align: 'center' });
    doc.text("From: " + from + " To: " + to, doc.internal.pageSize.width / 2, y = y + 20, { align: 'center' });

    doc.autoTable({
        html: '#statistics',
        startY: y = y + 20,
        theme: 'grid',
        showHead: 'everyPage',
        headStyles: {
            lineWidth: 1,
            fillColor: [60, 9, 108],
        },
        styles: {
            minCellHeight: 10,
        }
    })

    no = parseInt(number)
    var nextTable = 20 * (no + 2)
    console.log(nextTable)

    doc.autoTable({
        html: '#data',
        startY: y + nextTable,
        theme: 'grid',
        showHead: 'everyPage',
        headStyles: {
            lineWidth: 1,
            fillColor: [60, 9, 108],
        },
        styles: {
            minCellHeight: 10,
        }
    })

    const pageCount = doc.internal.getNumberOfPages()

    doc.setFont('helvetica', 'italic')
    doc.setFontSize(9)
    for (var i = 1; i <= pageCount; i++) {
        doc.setPage(i)
        var date = new Date();
        doc.text("Report generated on - " + date, doc.internal.pageSize.width / 2, doc.internal.pageSize.height - 20,
            { align: 'center' })
    }
    doc.save(reportName + '.pdf');
}
